import {Component} from "react";

export function Selector(props){

    const {title,changeValueParentHandler, parentValue,options} = props;

    return <label>{title}
                <select onChange={changeValueParentHandler} 
                        value={parentValue}>
                    {options.map(option=> <option {...option}></option>)}
                </select>
            </label>
    
}
